  [],\n\t\"revision_timestamp\": \"2015-05-06T22:32:33.225654\",\n\t\"name\": \"extremely-high-suction-performance-inducers-for-space-propulsion-project-9ae3f\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The proposed innovation provides a way to
  design low flow coefficient inducers that have higher cavitation breakdown margin,
  larger blade angles, thicker more structurally robust blades, and better off-design
  flow stability than the current state-of-the-art designs.  The technology will increase
  the structural, stability, and suction margin of inducers designed in the currently
  acceptable flow coefficient range of about 0.06 to 0.1.  In addition, it will allow
  for stable and structurally robust designs at much lower flow coefficients than
  previously thought possible (down to at least 0.02) for the capability to operate
  in near zero net positive suction pressure inlet environments.  The innovation is
  based upon a synergistic coupling of Concepts NREC's patented cavitation control
  device with a new blade design approach that takes full advantage of the CCD's characteristics
  for optimal suction performance.  The technology significantly enhances the capability
  of rocket engine systems through increased thrust-to-weight, specific impulse, simplicity,
  operational safety, and turbopump life.  It will also reduce turbopump and propellant
  tank weight and system costs by eliminating boost pump systems and allowing for
  lighter lower pressure tanks.  \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
